	Log.Notice('backgroundColor=' + backgroundColor);

	form = document.forms["bg"];
	var x =  parseInt(form["x"].value);
	var y = parseInt(form["y"].value);
	var h = parseInt(form["h"].value);

function hiliteObjects(selector, duration, startAttrs, endAttrs, startStyles, endStyles) {
	
	var selection = d3.selectAll(selector);
	
	selection
		.transition()
		.duration(duration)
		.ease('linear')
		.attr(endAttrs)
		.style(endStyles);
	
}
